import React from "react";
import Header from "../Header/Header";
import service from "../../assests/aboutus.jpg";

const Service = () => {
  const services = [
    {
      name: "Logo Identity",
    },
    {
      name: "Web and App Design",
    },
    {
      name: "Businesses and Advertising",
    },
    {
      name: "Clothing and Merchandise",
    },
    {
      name: "Art and Illistration",
    },
    {
      name: "Packages and Label",
    },
    {
      name: "Book and Magzine",
    },
    {
      name: "Others",
    },
  ];
  return (
    <div className="w-full h-full">
      <Header />
      <div className="flex h-[115px] mx-auto bg-[#F0F0F0] w-full">
        <div className="flex w-1/3 justify-center items-center text-center">
          <h1 className="text-[20px] uppercase py-[20px] text-[#777777] tracking-widest font-bold leading-[60px]">
            Services
          </h1>
        </div>
        <div className="flex w-2/3 justify-center items-center text-center">
          <div className="flex gap-2 text-[18px] text-[#777777] tracking-widest">
            <a href="/" className="text-[#FF004F] uppercase">
              Home
            </a>
            <span>/ Services</span>
          </div>
        </div>
      </div>
      <img src={service} alt="service" className="w-full h-[600px]" />
      <div className="w-full">
        <div className="grid grid-col-4 w-[1300px]">
          {services.map((items) => {
            <div>
              <h2>{items.name}</h2>
            </div>;
          })}
        </div>
      </div>
    </div>
  );
};

export default Service;
